	(244,'My Unique Value Proposition','[{\"show\":true,\"title\":\"My UVP\",\"overview\":\"Most business people don\\u2019t understand what business they are in. Sure, they know their product, but do not understand the true basis on which they compete. So, you sell shoes\\u2014 but is that enough to make your customer want to buy from you?\",\"file_type\":\"worksheet\",\"file\":null,\"template\":{\"id\":364,\"sections\":\"[{\\\"title\\\":\\\"How I will compete to win\\\",\\\"description\\\":\\\"<div class=\\\\\\\"page\\\\\\\" title=\\\\\\\"Page 17\\\\\\\">\\\\n<div class=\\\\\\\"layoutArea\\\\\\\">\\\\n<div class=\\\\\\\"column\\\\\\\">\\\\n<p style=\\\\\\\"text-align: center;\\\\\\\"><em>&ldquo;The more you understand about your own company and how you differ from others, the better you are able to compete.&rdquo;<\\\\\\/em><\\\\\\/p>\\\\n<p>Understanding the needs, interests, habits, and preferences of your customers is the key to providing exceptional customer experiences. Your UVP helps you connect with your target market by articulating your value to your customer and what makes you different.<\\\\\\/p>\\\\n<\\\\\\/div>\\\\n<\\\\\\/div>\\\\n<\\\\\\/div>\\\",\\\"showSection\\\":true,\\\"questions\\\":[{\\\"fixed\\\":false,\\\"showQuestion\\\":false,\\\"question\\\":\\\"Briefly summarize your customer\\\\u2019s pain point and how your product solves it:\\\",\\\"addSubQuestion\\\":true,\\\"subQuestion\\\":[{\\\"show\\\":true,\\\"question\\\":null,\\\"placeholders\\\":[{\\\"placeholder\\\":\\\"My Customer\\\",\\\"response\\\":null},{\\\"placeholder\\\":\\\"Their problem\\\",\\\"response\\\":null},{\\\"placeholder\\\":\\\"How my product\\\\\\/service solves it\\\",\\\"response\\\":null}],\\\"limit\\\":2,\\\"options\\\":[{\\\"value\\\":null}],\\\"answer\\\":null,\\\"answers\\\":[],\\\"response\\\":null,\\\"responses\\\":[],\\\"response_count\\\":null}],\\\"response\\\":null,\\\"responses\\\":[],\\\"result\\\":null,\\\"type\\\":\\\"long\\\",\\\"limit\\\":2,\\\"options\\\":[{\\\"value\\\":null}],\\\"showAnswer\\\":false,\\\"answer\\\":null,\\\"answers\\\":[],\\\"placeholders\\\":[{\\\"placeholder\\\":null,\\\"response\\\":null}],\\\"placeholder\\\":null,\\\"hint\\\":null,\\\"score\\\":0}]}]\",\"interest\":null,\"title\":\"My Unique Value Proposition\",\"organization_id\":74,\"created_at\":\"2021-07-26T09:08:19.000000Z\",\"updated_at\":\"2021-07-28T19:19:20.000000Z\",\"type\":\"worksheet\",\"status\":\"active\",\"user_id\":null,\"admin_id\":null,\"facilitator_id\":44,\"totalscore\":null,\"options\":\"{\\\"grading\\\":false,\\\"correct_answer\\\":false,\\\"time\\\":false}\",\"duration\":null},\"templates\":[],\"type\":\"worksheet\"}]',254,44,74,'2021-07-28 19:31:14','2021-07-28 19:31:14',NULL),
	(254,'Marketing plan guide','[{\"show\":true,\"title\":\"Marketing plan guide\",\"overview\":\"You will get shortcuts to finding critical business information\\u2014 whether it be about your industry, target market, competitors, or other business information you\\u2019ll need  to help you build your business and make decisions.\\nThe emphasis will be on finding such information fast, easily and hopefully free.\",\"file_type\":\"worksheet\",\"file\":null,\"template\":{\"id\":374,\"sections\":\"[{\\\"title\\\":\\\"Here\'s what to note\\\",\\\"description\\\":\\\"<p class=\\\\\\\"p1\\\\\\\">This module aims at sharpening your understanding of your marketplace: your competitors, geographical boundaries, types of customers you sell to, existing distribution channels, latest and most useful demographic data, any information on trends in your markets (both demographic and product-related)<\\\\\\/p>\\\\n<p class=\\\\\\\"p1\\\\\\\">However, this is dependent on your research abilities. The word &lsquo;research&rsquo; probably conjures up school projects, but this kind of research isn&rsquo;t like that. Instead you&rsquo;ll get shortcuts to finding critical business information&mdash; whether it be about your industry, target market, competitors, or other business information you&rsquo;ll need<span class=\\\\\\\"Apple-converted-space\\\\\\\">&nbsp; <\\\\\\/span>to help you build your business and make decisions.<\\\\\\/p>\\\\n<p class=\\\\\\\"p1\\\\\\\">The emphasis will be on finding such information fast, easily and hopefully free.<\\\\\\/p>\\\\n<p class=\\\\\\\"p1\\\\\\\">We&rsquo;re also going to use a number of frameworks on the w<span class=\\\\\\\"s1\\\\\\\">orksheets<\\\\\\/span> to answer such questions as:<\\\\\\/p>\\\\n<ul>\\\\n<li class=\\\\\\\"p1\\\\\\\">Who is really your customer?<\\\\\\/li>\\\\n<li class=\\\\\\\"p1\\\\\\\">What companies are already providing such a service?<\\\\\\/li>\\\\n<li class=\\\\\\\"p1\\\\\\\">What is the addressable market size for this kind of product\\\\\\/service?<\\\\\\/li>\\\\n<li class=\\\\\\\"p1\\\\\\\">What are indicators that there are consumers who would be willing to get the product\\\\\\/service you&rsquo;re proposing?<\\\\\\/li>\\\\n<li class=\\\\\\\"p1\\\\\\\">What portion of the existing market can you realistically capture?<\\\\\\/li>\\\\n<li class=\\\\\\\"p1\\\\\\\">What are the costs involved in providing the proposed product\\\\\\/service?<\\\\\\/li>\\\\n<li class=\\\\\\\"p1\\\\\\\">What are the key activities, resources such as technology and partnerships needed to provide proposed product\\\\\\/service?<\\\\\\/li>\\\\n<li class=\\\\\\\"p1\\\\\\\">What are the laws and regulatory implications of offering such products and services?<\\\\\\/li>\\\\n<\\\\\\/ul>\\\\n<p class=\\\\\\\"p1\\\\\\\">But first, lets discuss how to get started:<\\\\\\/p>\\\\n<p class=\\\\\\\"p1\\\\\\\"><strong>Defining your target market:<\\\\\\/strong><\\\\\\/p>\\\\n<p class=\\\\\\\"p1\\\\\\\"><em>Even if you think you&rsquo;ll market directly to consumers online, you will soon discover that there are still many entities between you and your customer.<\\\\\\/em><\\\\\\/p>\\\\n<p class=\\\\\\\"p1\\\\\\\">Let&rsquo;s say you&rsquo;ve created a new breakfast cereal for children. You&rsquo;ve packed it with good things: vitamins, minerals, great nutrition etc. You have enough punch to wipe out competition, because every parent wants a nutritious breakfast for their child. Who is your customer? Is it mum or dad pushing the grocery cart down the cereal aisle, comparing the nutrition information on the side of the box? Or is it the end-user (the &ldquo;Consumer&rdquo;) of your product&mdash; the kid&mdash; who couldn&rsquo;t care less about nutrition, but wants cereal that tastes sweet, has cartoon characters on the package, and packs toys inside?<\\\\\\/p>\\\\n<p class=\\\\\\\"p1\\\\\\\">Confused yet? hehe! typically your customers cut across different categories that grows as you get closer to the end user. See outline below:<\\\\\\/p>\\\\n<ul>\\\\n<li class=\\\\\\\"p1\\\\\\\">End User\\\\\\/Consumer<\\\\\\/li>\\\\n<li class=\\\\\\\"p1\\\\\\\">Purchaser\\\\\\/Decision Maker<\\\\\\/li>\\\\n<li class=\\\\\\\"p1\\\\\\\">Retail Sales Personnel<\\\\\\/li>\\\\n<li class=\\\\\\\"p1\\\\\\\">Retailer Decision Makers<\\\\\\/li>\\\\n<li class=\\\\\\\"p1\\\\\\\">Wholesale\\\\\\/Distributor Sales Personnel<\\\\\\/li>\\\\n<li class=\\\\\\\"p1\\\\\\\">Wholesale\\\\\\/Distributor Decision Makers<\\\\\\/li>\\\\n<li class=\\\\\\\"p1\\\\\\\">Others<\\\\\\/li>\\\\n<\\\\\\/ul>\\\\n<p class=\\\\\\\"p1\\\\\\\">Give yourself a competitive edge by thinking of each of these customers and plan for their needs and motivation. I know its hard to see why now, but being responsive to details that are important to distributors, retailers, sales reps etc. help you plan your marketing materials, operation, packaging and even the nature of the product itself.<\\\\\\/p>\\\\n<p class=\\\\\\\"p1\\\\\\\">Even if you think you&rsquo;ll market directly to consumers online, you will soon discover that there are still many entities between you and your customer, it could be the algorithm of your preferred social media platform, or the search engine that will help customers find you.<\\\\\\/p>\\\",\\\"showSection\\\":true,\\\"questions\\\":[{\\\"fixed\\\":false,\\\"showQuestion\\\":true,\\\"question\\\":\\\"Ready to reach those customers of yours?\\\",\\\"addSubQuestion\\\":false,\\\"subQuestion\\\":[{\\\"show\\\":true,\\\"question\\\":null,\\\"placeholders\\\":[{\\\"placeholder\\\":null,\\\"response\\\":null}],\\\"limit\\\":2,\\\"options\\\":[{\\\"value\\\":null}],\\\"answer\\\":null,\\\"answers\\\":[],\\\"response\\\":null,\\\"responses\\\":[],\\\"response_count\\\":null}],\\\"response\\\":null,\\\"responses\\\":[],\\\"result\\\":null,\\\"type\\\":\\\"single\\\",\\\"limit\\\":2,\\\"options\\\":[{\\\"value\\\":\\\"Yesssuur!\\\"},{\\\"value\\\":\\\"Can\'t wait!\\\"}],\\\"showAnswer\\\":false,\\\"answer\\\":null,\\\"answers\\\":[],\\\"placeholders\\\":[{\\\"placeholder\\\":null,\\\"response\\\":null}],\\\"placeholder\\\":null,\\\"hint\\\":null,\\\"score\\\":0}]}]\",\"interest\":null,\"title\":\"A guide to developing your marketing plan\",\"organization_id\":74,\"created_at\":\"2021-07-29T00:32:34.000000Z\",\"updated_at\":\"2021-07-29T10:46:59.000000Z\",\"type\":\"worksheet\",\"status\":\"active\",\"user_id\":null,\"admin_id\":null,\"facilitator_id\":44,\"totalscore\":null,\"options\":\"{\\\"grading\\\":false,\\\"correct_answer\\\":false,\\\"time\\\":false}\",\"duration\":null},\"templates\":[],\"type\":\"worksheet\"}]',394,44,74,'2021-07-29 10:52:15','2021-07-29 10:52:15',NULL),
